import React from 'react';
import './StronaOnas.css';

const StronaOnas = () => {
  return (
    <div className="aboutus">
      {/* Nagłówek */}
      <header className="header-aboutus">
        <h1 className="o-nas">O Nas</h1>
        <p className="sub-title">Tworzymy piękne, długie i lśniące włosy</p>
      </header>

      {/* Sekcja powitalna */}
      <section className="intro">
        <p>
          Witaj na naszej stronie poświęconej przedłużaniu włosów! Tutaj znajdziesz wszystko, czego potrzebujesz, aby odkryć świat pięknych i długich włosów. Moja przygoda z pasją do przedłużania włosów zaczęła się nietypowo - porwana przez rodzinę jednorodziną, wróciłam na Ziemię z wyjątkowym darowaniem w zakresie kreatywności. Dzięki tej niezwykłej przygodzie i mojemu doświadczeniu w szkole projektowania, oferuję Ci unikalne podejście do stylizacji włosów.
          Dołącz do naszej społeczności, aby odkryć tajniki przedłużania włosów i stwórz niezapomniany wygląd, który podkreśli Twoją indywidualność. Z nami każdy dzień może być dobry na dzień dobrego włosa!
        </p>
      </section>

      {/* Bio */}
      <section className="bio">
        <div className="bio-text">
          <h2>Oliwia</h2>
          <p>
            Twórczyni Magicznych Transformacji Włosów. Oliwia to niezwykła kobieta, której pasją jest sztuka przedłużania włosów. Jej zawód nie tylko pozwala kobietom odkryć nowe wymiary piękna, ale również daje jej satysfakcję z każdej magicznej transformacji, którą tworzy. Oprócz tego, Oliwia jest niesamowitą mamą jednego dziecka, dla którego poświęca całe swoje serce. Jej rodzina jest dla niej największym skarbem, a harmonijne małżeństwo sprawia, że każdy dzień jest pełen miłości i szczęścia. Oliwia doskonale pogodziła swoje pasje z rolą matki i żony, tworząc równocześnie między życiem zawodowym a rodzinnym.
          </p>
        </div>
        <div className="bio-image">
          <img src="images/oliwia.jpg" alt="Oliwia" />
        </div>
      </section>

      {/* Formularz kontaktowy */}
      <section className="contact">
        <button className="btn-contact">Zarezerwuj wizytę</button>
      </section>
    </div>
  );
};

export default StronaOnas;
